import { Route } from "react-router-dom";

import LandingPage from "./pages/LandingPage";

function App() {
  return (
    <div>
      <Route path="/landingpage">
        <LandingPage />
      </Route>
      <Route path="/landingpage1">
        <LandingPage />
      </Route>
    </div>
  );
}

export default App;
